import React from 'react'
import { ContactContainer, TitleContainer } from './contact.styles'

const Contact = () => {
  return (
    <ContactContainer>
      <TitleContainer>Contact Me</TitleContainer>
    </ContactContainer>
  )
}

export default Contact
